IF ('$Redaktionen' = 'Sport')
THEN (SELECT NULL as summe_${webColor});
ELSE (SELECT
  SUM(COALESCE(m_visits,0)) as summe_${webColor}
FROM
  Piano.total_visits
WHERE site_level2 = '${app_name}'
  AND page_chapter1 = "$page_chapter1"
  AND page_chapter2 = "Alle Kapitel 2"
  AND sendungs_id = "Alle Sendungs-ID"
AND EXTRACT(MONTH from date) = $Monat AND EXTRACT(YEAR from date) = $Jahr
);
END IF

IF ('$Redaktionen' = 'Sport') THEN (
  SELECT
    NULL as summe_${webColor}
);
ELSE (
  SELECT
    ROUND(
      SUM(COALESCE(m_playbutton, 0)) / COUNT(DISTINCT(date)),
      0
    ) as summe_${webColor}
  FROM
    `Piano.av_joined_daily`
  WHERE
    site_level2 = '${app_name}'
    AND EXTRACT(
      MONTH
      from
        date
    ) = $Monat
    AND EXTRACT(
      YEAR
      from
        date
    ) = $Jahr
);
END IF

IF ('$Redaktionen' = 'Info' OR '$Redaktionen' = 'Kultur' OR '$Redaktionen' = 'Sport') THEN (
  SELECT 'N/A' as Web_${webColor}
);
ELSE (
  SELECT '${Redaktionen}' as Web_${webColor}, 
  FROM `ndr-code-bi-dashboard.Quintly.facebook`
  LIMIT 1
);
END IF

IF (
  '$Redaktionen' = 'Sport'
  OR '$Redaktionen' = 'Info'
  OR '$Redaktionen' = 'Kultur'
) THEN (
