    and $zeitraumTV 
    and target_group = '${Redaktionen}'
);
END IF

IF (
  '$Redaktionen' = 'Sport'
  OR '$Redaktionen' = 'Info'
  OR '$Redaktionen' = 'Kultur'
) THEN (
  SELECT
    NULL as summe_${webColor}
);
ELSE (
  SELECT
    avg(viewers) as summe_${webColor}
  FROM
