var categoryColors = {
  'Info': { 'Web': '#0277BF', 'App': '#a3c8ef' },
  'Sport': { 'Web': '#2568b4', 'App': '#abc3ed' },
  'Hamburg': { 'Web': '#D11426', 'App': '#faaea0' },
  'Niedersachsen': { 'Web': '#F06600', 'App': '#ffbe96' },
  'Schleswig-Holstein': { 'Web': '#009AD2', 'App': '#9bd5f3' },
  'Mecklenburg-Vorpommern': { 'Web': '#009F9F', 'App': '#90dad8' },
  'Kultur': { 'Web': '#b63929', 'App': '#f1b09f' },
};



// Initialen Daten holen
const redaktionField = context.panel.data.series[0].fields.find((f) => f.name === 'redaktion');
const appField = context.panel.data.series[0].fields.find((f) => f.name === 'App');
const webField = context.panel.data.series[0].fields.find((f) => f.name === 'Web');
const timeField = context.panel.data.series[0].fields.find((f) => f.name === 'date');

let redaktion = [];
let app = [];
let web = [];
let time = [];

redaktion = redaktionField.values.toArray();
app = appField.values.toArray();
web = webField.values.toArray();
time = timeField.values.toArray();

const colorIndicator = redaktion[0];

let formattedTime = [];
time.forEach(function (item) {
  let oldDate = item;
  let newDate = oldDate.slice(8) + "." + oldDate.slice(5, 7) + "." + oldDate.slice(0, 4);
  formattedTime.push(newDate);
});

const series = [
  {
    name: 'App',
    type: 'line',
    colorBy: 'series',
    color: categoryColors[colorIndicator]['App'],
    data: time.map((t, i) => {
      const v = app[i];
      return {
        value: v,
        name: t,
      }
    }),
  },
  {
    name: 'Web',
    type: 'line',
    colorBy: 'series',
    color: categoryColors[colorIndicator]['Web'],
    data: time.map((t, i) => {
      const v = web[i];
      return {
        value: v,
        name: t,
      };
    }),
  }
];

return {
  backgroundColor: 'transparent',
  tooltip: {
    trigger: 'axis',
    valueFormatter: function (value) {
      let labelContent = '';
      let number = value.toFixed(0);
      let formattedNumber = new Intl.NumberFormat('de-DE').format(number);;
      labelContent = formattedNumber;
      return labelContent
    }
  },
  legend: {
    orient: 'horizontal',
    bottom: '0',
  },
  xAxis: {
    data: formattedTime,
    show: true,
    type: 'category',
    axisTick: {
      alignWithLabel: true,
    }
  },
  yAxis:
  {
    type: 'value',
    axisLabel: {
      formatter: function (value, index) {
        let formattedNumber = new Intl.NumberFormat('de-DE').format(value);
        return formattedNumber
      }
    }
  },
  series,
  toolbox: {
    feature: {
      dataZoom: {
        yAxisIndex: 'none'
      },
      saveAsImage: {}
    }
  },
  grid: {
    left: '2%',
    right: '5%',
    top: 25,
    bottom: 25,
    containLabel: true,
  },
};

